import CardList from './CardList';
import {cats} from './cats';
import SearchBox from './SearchBox';


const state = {
	cats: cats,
	searchfield: ''
}

class App extends Component {
	render(){
		return (
		<div className='tc'>
			<h1>Kitties</h1>
			<SearchBox />
			<CardList cats={cats}/>;
		</div>
		);	
	}
}

export default App;
